edgeJSON = []

def matchingID(x, id):
    if x["speciesID"] == int(id):
        return True
    return False

with open('csvs/new/G7-edges.csv') as csvfile:
    spamreader = csv.reader(csvfile, delimiter=',')
    i = 0
    
    for row in spamreader:
        if row[0] != "ResourceSpeciesID":
            rsID = row[0]
            cID = row[1]

            rsIndex = [x["index"] for x in nodeJSON if matchingID(x, rsID)][0]
            cIndex = [x["index"] for x in nodeJSON if matchingID(x, cID)][0]

            edgeJSON.append({"target": rsIndex, "source": cIndex, "Type": row[2]})
            i+=1
            print(i)


print(json.dumps(edgeJSON))